<!DOCTYPE html>
<!-- saved from url=(0016)http://localhost -->
<html>
<head>
    <meta http-equiv="X-UA-Compatible" content="IE=11" />
    <title></title>
    <script type="text/javascript">
        window.addEventListener("message", function(e) {
            if (e.origin === window.location.protocol + "//" + window.location.host && e.source == window.opener) {
                document.write(e.data);
            }
        });

        // Send a message to the opener to say we're ready to receive data.
        if (window.opener) {
            window.opener.postMessage("READY", window.location.protocol + "//" + window.location.host);
        }
    </script>
    <style type="text/css">
        
    </style>
</head>
<body>

</body>
</html>
